def isFemForm (s):
    "returns True if s exists in dMasFW"
    return s in _dMasFW

def getMasForm (s, bPlur):
    "returns masculine form with feminine form"
    if s in _dMasFW:
        return _modifyStringWithSuffixCode(s, _whatSuffixCode(_lTags[_dMasFW[s]], bPlur))
    return ""

def isMiscPlural (s):
    "returns True if s exists in dPlurMisc"
    return s in _dPlurMisc

def getMiscPlural (s):
    "returns plural form with singular form"
    if s in _dPlurMisc:
        return _modifyStringWithSuffixCode(s, _lTags[_dPlurMisc[s]])
    return ""

def _whatSuffixCode (sAff, bPlur):
    "necessary only for dMasFW"
    if bPlur:
        if "|" not in sAff:
            return sAff+"s"
        return sAff[sAff.find("|")+1:]
    if "|" in sAff:
        return sAff[:sAff.find("|")]
    return sAff

def _modifyStringWithSuffixCode (s, sAff):
    "returns s modified by sAff"
    if not sAff:
        return ""
    if sAff == "0":
        return s
    try:
        return s[:-(ord(sAff[0])-48)] + sAff[1:]  if sAff[0] != '0'  else  s + sAff[1:]  # 48 is the ASCII code for "0"
    except:
        return u"## erreur, code : " + str(sAff) + " ##"
